    "contracts/TokenBatch.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.10;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol";
import "hardhat/console.sol";
import "./IClaimable.sol";
import "hardhat/console.sol";
import "./UniswapV3Proxy.sol";

contract TokenBatch is ERC1155Holder {
    event PurchaseIdTransferComplete(
        address purchaser,
        uint256 amount,
        bool completedPurchase
    );
    event BatchERC20TransferComplete(address[] addresses, uint256[] balances);
    event BatchERC1155ClaimComplete(address[] addresses, uint256[] tokenIds);
    event BatchGasTokenTransferComplete(
        address payable[] addresses,
        uint256[] balances
    );

    struct PercentagesResult {
        uint8[] percentages;
        uint8 totalPercentage;
    }

    struct TransferParams {
        uint256 revenueToSend;
        uint256 swappedAmount;
        uint256[] balances;
        uint8[] percentages;
        address tokenToTransfer;
        address[] addresses;
    }

    // The total revenue collected from a given address. Up until totalRevenue[addr] == idPurchasePrice, we collect revenue from this user.
    mapping(address => uint256) totalRevenue;

    // The cmorq revenue wallet address, where ID purchases are sent.
    address public revenueWallet;

    // The price of purchasing ID.
    uint256 public idPurchasePrice;

    /**
     * @dev Sets the revenue wallet
     *
     */
    constructor(address _revenueWallet, uint256 _idPurchasePrice) {
        revenueWallet = _revenueWallet;
        idPurchasePrice = _idPurchasePrice;
    }

    /**
     * @dev Transfers {IERC20 token} to {addresses}, and claims {IClaimable tokenId} upon completion
     *
     * @param _collection The collection of the NFT to transfer
     * @param _addresses The addresses to transfer to
     * @param _balances The balances of the token to transfer to each address.
     * @param _tokenIds The token IDs of which NFT to transfer after completion
     * @param _priorPurchaseAmounts The previous amount users have paid to purchase ID, in order to backfill
     * @param _swapProxyAddress The proxy to pass swaps through
     * @param _params The Uniswap swap params to call proxy with
     *
     * @return _success Returns true if success
     */
    function batchSwapTransferErc20AndClaimNftWithRevenue(
        address _collection,
        address[] calldata _addresses,
        uint256[] calldata _tokenIds,
        uint256[] calldata _priorPurchaseAmounts,
        uint256[] memory _balances,
        address payable _swapProxyAddress,
        UniswapV3Proxy.SwapAndClaimNft memory _params
    ) public returns (bool) {
        // Ensure all arrays are of even length
        require(
            _addresses.length == _priorPurchaseAmounts.length &&
                _addresses.length == _balances.length,
            "Mismatch in length of _addresses, _priorPurchaseAmounts, and _balances"
        );

        // Ensure sender has sufficient balance to process the transaction
        require(
            IERC20(_params.tokenIn).balanceOf(msg.sender) >=
                calculateTotalBalance(_balances),
            "Insufficient tokens to complete full batch transfer"
        );

        // Calculate revenue amount for each address
        // NOTE: Revenue is PRICED in from-token, but sent in to-token. We update the
        //  value of totalRevenue before doing the swap. This allows us to not worry
        //  about price fluctuations
        uint256 revenueToSend = 0;
        (revenueToSend, _balances) = calculateRevenue(
            _addresses,
            _priorPurchaseAmounts,
            _balances
        );

        // Swap from-token to to-token
        _params.amountIn = calculateTotalBalance(_balances);
        uint256 transferAmountSwapped = 0;
        transferAmountSwapped = swapTokens(
            calculateTotalBalance(_balances),
            _swapProxyAddress,
            _params
        );
        require(transferAmountSwapped > 0, "Cannot send 0");

        // Calculates percentages each token will get
        PercentagesResult memory percentageResult = calculatePercentages(
            _balances
        );
        for (uint256 i = 0; i < _balances.length; i++) {
            percentageResult.percentages[i] = calculateTotalBalance(
                _balances
            ) == 0
                ? 0
                : uint8(
                    (_balances[i] * 100) / calculateTotalBalance(_balances)
                );
            percentageResult.totalPercentage += percentageResult.percentages[i];
        }
        percentageResult.percentages[_balances.length] =
            100 -
            percentageResult.totalPercentage;

        // Transfer tokens to users
        require(
            IERC20(_params.tokenOut).approve(
                _params.tokenOut,
                transferAmountSwapped
            ),
            "Failed to approve token transfer out"
        );
        TransferParams memory params = TransferParams({
            revenueToSend: revenueToSend,
            swappedAmount: transferAmountSwapped,
            balances: _balances,
            percentages: percentageResult.percentages,
            tokenToTransfer: _params.tokenOut,
            addresses: _addresses
        });
        transferTokens(params);

        require(
            batchClaimERC1155Claimable(_collection, _addresses, _tokenIds),
            "Claim failed"
        );

        return true;
    }

    /**
     * @dev Calculates releative percentages of balances and revenue for exchanging
     *
     * @param _balances the user balances to transfer
     *
     * @return percentageResults the relative percentages and total percentage
     */
    function calculatePercentages(
        uint256[] memory _balances
    ) internal pure returns (PercentagesResult memory) {
        uint8[] memory percentages = new uint8[](_balances.length + 1);
        uint8 totalPercentage = 0;
        uint256 totalBalance = calculateTotalBalance(_balances);

        for (uint256 i = 0; i < _balances.length; i++) {
            percentages[i] = totalBalance == 0
                ? 0
                : uint8((_balances[i] * 100) / totalBalance);
            totalPercentage += percentages[i];
        }

        percentages[_balances.length] = 100 - totalPercentage;

        return
            PercentagesResult({
                percentages: percentages,
                totalPercentage: totalPercentage
            });
    }

    /**
     * @dev Transfers tokens to end users
     *
     * @param _transferParams the parameters used to easily transfer tokens
     */
    function transferTokens(TransferParams memory _transferParams) private {
        for (uint256 i = 0; i <= _transferParams.balances.length; i++) {
            if (
                i == _transferParams.balances.length &&
                _transferParams.revenueToSend > 0
            ) {
                // transfer to revenue
                require(
                    IERC20(_transferParams.tokenToTransfer).transfer(
                        revenueWallet,
                        (_transferParams.swappedAmount *
                            _transferParams.percentages[i]) / 100
                    ),
                    "Transfer to revenue failed"
                );
            } else if (_transferParams.balances[i] > 0) {
                // transfer to EOA
                require(
                    IERC20(_transferParams.tokenToTransfer).transfer(
                        _transferParams.addresses[i],
                        (_transferParams.swappedAmount *
                            _transferParams.percentages[i]) / 100
                    ),
                    "Transfer to address failed"
                );
            }
        }
    }

    /**
     * @dev calcualtes revenue and new balances
     *
     * @param _addresses addresses to process
     * @param _priorPurchaseAmounts handling prior purchases
     * @param _balances the balances to be transferred
     */
    function calculateRevenue(
        address[] calldata _addresses,
        uint256[] calldata _priorPurchaseAmounts,
        uint256[] memory _balances
    ) internal returns (uint256 revenueToSend, uint256[] memory) {
        for (uint256 i = 0; i < _addresses.length; i++) {
            // Backfill totalRevenue based on prior contracts.
            // If this contract has 0 and we're sending a priorAmount, we know the
            //  user has previously purchased.
            if (
                totalRevenue[_addresses[i]] == 0 &&
                _priorPurchaseAmounts[i] != 0
            ) {
                totalRevenue[_addresses[i]] = _priorPurchaseAmounts[i];
            }

            // Calculate the additional revenue to take for this address
            // If the amount is greater than the purchase amount, take the full
            //  purchase amount
            uint256 newRevenue = idPurchasePrice - totalRevenue[_addresses[i]];
            if (_balances[i] < newRevenue) {
                newRevenue = _balances[i];
            }

            // Add to total revenue for the user
            totalRevenue[_addresses[i]] = newRevenue;

            // Update the balance to send to the user
            _balances[i] = _balances[i] - newRevenue;

            // Update the balance to send to the revenue address
            revenueToSend += newRevenue;
        }
        return (revenueToSend, _balances);
    }

    /**
     * @dev Swaps tokens using a swap proxy
     *
     * @param _transferAmount The amount to swap
     * @param _swapProxyAddress The swap proxy address
     * @param _params The Uniswap params
     *
     * @return amountOut The amount received
     */
    function swapTokens(
        uint256 _transferAmount,
        address payable _swapProxyAddress,
        UniswapV3Proxy.SwapAndClaimNft memory _params
    ) internal returns (uint256) {
        require(
            IERC20(_params.tokenIn).transferFrom(
                msg.sender,
                address(this),
                _transferAmount
            ) &&
                IERC20(_params.tokenIn).approve(
                    _swapProxyAddress,
                    _transferAmount
                ),
            "Failed to transfer tokens into proxy or to approve proxy on SwapRouter"
        );
        _params.amountIn = _transferAmount;
        return UniswapV3Proxy(_swapProxyAddress).swapAndClaimNft(_params);
    }

    /**
     * @dev Transfers {IERC20 token} to {addresses}, and claims {IClaimable tokenId} upon completion
     *
     * NOTE: All amounts should be in base units. Example:
     * - Transferring 10 USDC
     * - _balances[i] = 10*10^6
     *
     * @param _token The token to transfer
     * @param _collection The collection of the NFT to transfer
     * @param _addresses The addresses to transfer to
     * @param _balances The balances of the token to transfer to each address.
     * @param _tokenIds The token IDs of which NFT to transfer after completion
     *
     * @return _success Returns true if success
     */
    function batchTransferErc20AndClaimNftWithRevenue(
        address _token,
        address _collection,
        address[] calldata _addresses,
        uint256[] calldata _balances,
        uint256[] calldata _tokenIds
    ) public returns (bool) {
        require(
            batchTransferErc20WithRevenue(_token, _addresses, _balances),
            "Transfer failed"
        );
        require(
            batchClaimERC1155Claimable(_collection, _addresses, _tokenIds),
            "Claim failed"
        );
        return true;
    }

    /**
     * @dev Transfers {IERC20 token} to {addresses}, and claims {IClaimable tokenId} upon completion
     *
     * NOTE: All amounts should be in base units. Example:
     * - Transferring 10 USDC
     * - _balances[i] = 10*10^6
     *
     * @param _token The token to transfer
     * @param _collection The collection of the NFT to transfer
     * @param _addresses The addresses to transfer to
     * @param _balances The balances of the token to transfer to each address.
     * @param _tokenIds The token IDs of which NFT to transfer after completion
     *
     * @return _success Returns true if success
     */
    function batchTransferErc20AndClaimNft(
        address _token,
        address _collection,
        address[] calldata _addresses,
        uint256[] calldata _balances,
        uint256[] calldata _tokenIds
    ) public returns (bool) {
        require(
            batchTransferErc20(_token, _addresses, _balances),
            "Transfer failed"
        );
        require(
            batchClaimERC1155Claimable(_collection, _addresses, _tokenIds),
            "Claim failed"
        );
        return true;
    }

    /**
     * @dev Transfers {ERC20 token} to {addresses}.
     *
     * NOTE: All amounts should be in base units. Example:
     * - Transferring 10 USDC
     * - _balances[i] = 10*10^6
     *
     * @param _token The token to transfer
     * @param _addresses The addresses to transfer to
     * @param _balances The balances of the token to transfer to each address.
     *
     * @return _success Returns true if success
     */
    function batchTransferErc20WithRevenue(
        address _token,
        address[] calldata _addresses,
        uint256[] memory _balances
    ) public returns (bool) {
        require(
            _addresses.length == _balances.length,
            "Each address must have a corresponding balance to send"
        );

        uint256 totalBalance = 0;
        IERC20 token = IERC20(_token);

        for (uint256 i = 0; i < _balances.length; i++) {
            totalBalance += _balances[i];
        }

        require(
            token.balanceOf(msg.sender) >= totalBalance,
            "Sender must have at least as many tokens needed to complete full batch transfer"
        );

        for (uint256 i = 0; i < _addresses.length; i++) {
            uint256 transferAmount = _balances[i];

            // Purchase ID if necessary
            if (totalRevenue[_addresses[i]] < idPurchasePrice) {
                uint256 amountToUseForIdPurchase = idPurchasePrice -
                    totalRevenue[_addresses[i]];
                if (_balances[i] < amountToUseForIdPurchase) {
                    amountToUseForIdPurchase = _balances[i];
                }
                require(
                    token.transferFrom(
                        msg.sender,
                        revenueWallet,
                        amountToUseForIdPurchase
                    ),
                    "ID purchase failed"
                );
                totalRevenue[_addresses[i]] =
                    totalRevenue[_addresses[i]] +
                    amountToUseForIdPurchase;
                transferAmount = _balances[i] - amountToUseForIdPurchase;
                bool completedPurchase = false;
                if (totalRevenue[_addresses[i]] == idPurchasePrice) {
                    completedPurchase = true;
                }
                emit PurchaseIdTransferComplete(
                    _addresses[i],
                    amountToUseForIdPurchase,
                    completedPurchase
                );
            }

            // Send the remaining amount
            if (transferAmount > 0) {
                require(
                    token.transferFrom(
                        msg.sender,
                        _addresses[i],
                        transferAmount
                    ),
                    "Transfer failed"
                );
            }
        }
        emit BatchERC20TransferComplete(_addresses, _balances);
        return true;
    }

    function calculateTotalBalance(
        uint256[] memory _balances
    ) internal pure returns (uint256) {
        uint256 totalBalance = 0;
        for (uint256 i = 0; i < _balances.length; i++) {
            totalBalance += _balances[i];
        }
        return totalBalance;
    }

    /**
     * @dev Transfers {ERC20 token} to {addresses}.
     *
     * NOTE: All amounts should be in base units. Example:
     * - Transferring 10 USDC
     * - _balances[i] = 10*10^6
     *
     * @param _token The token to transfer
     * @param _addresses The addresses to transfer to
     * @param _balances The balances of the token to transfer to each address.
     *
     * @return _success Returns true if success
     */
    function batchTransferErc20(
        address _token,
        address[] calldata _addresses,
        uint256[] calldata _balances
    ) public returns (bool) {
        require(
            _addresses.length == _balances.length,
            "Each address must have a corresponding balance to send"
        );

        uint256 totalBalance = 0;
        IERC20 token = IERC20(_token);

        for (uint256 i = 0; i < _balances.length; i++) {
            totalBalance += _balances[i];
        }

        require(
            token.balanceOf(msg.sender) >= totalBalance,
            "Sender must have at least as many tokens needed to complete full batch transfer"
        );

        for (uint256 i = 0; i < _addresses.length; i++) {
            require(
                token.transferFrom(msg.sender, _addresses[i], _balances[i]),
                "Transfer failed"
            );
        }
        emit BatchERC20TransferComplete(_addresses, _balances);
        return true;
    }

    /**
     * @dev Claims {ERC1155 _tokenId[i]} to {addresses}.
     *
     * @param _collection The collection (i.e., contract address) of the token to claim
     * @param _addresses The addresses to claim to
     * @param _tokenIds The token ID to claim for each address
     *
     * @return _success Returns true if success
     */
    function batchClaimERC1155Claimable(
        address _collection,
        address[] calldata _addresses,
        uint256[] calldata _tokenIds
    ) public returns (bool) {
        require(
            _addresses.length == _tokenIds.length,
            "Each address must have a corresponding token ID to send"
        );

        IClaimable collection = IClaimable(_collection);

        for (uint256 i = 0; i < _addresses.length; i++) {
            if (collection.availableToClaim(_addresses[i], _tokenIds[i])) {
                collection.claim(_addresses[i], msg.sender, _tokenIds[i]);
            }
        }
        emit BatchERC1155ClaimComplete(_addresses, _tokenIds);
        return true;
    }

    /**
     * @dev Transfers gas token (e.g., ETH, MATIC) to {addresses}.
     *
     * NOTE: All amounts should be in base units. Example:
     * - Transferring 10 MATIC
     * - _balances[i] = 10*10^18
     *
     * @param _addresses The addresses to transfer to
     * @param _balances The balances of the token to transfer to each address.
     *
     * @return _success Returns true if success
     */
    function batchGasTokenTransfer(
        address payable[] calldata _addresses,
        uint256[] calldata _balances
    ) public payable returns (bool) {
        require(
            _addresses.length == _balances.length,
            "Each address must have a corresponding balance to send"
        );

        uint256 totalBalance = 0;
        for (uint256 i = 0; i < _balances.length; i++) {
            totalBalance += _balances[i];
        }

        require(
            msg.value >= totalBalance,
            "Sender must have sent at least as much gas tokens needed to complete full batch transfer"
        );

        for (uint256 i = 0; i < _addresses.length; i++) {
            require(_addresses[i].send(_balances[i]), "Transfer failed");
        }
        emit BatchGasTokenTransferComplete(_addresses, _balances);
        return true;
    }
}
"
